import React from "react";
import { Provider } from "react-redux";
import { StyleSheet, View, Text } from "react-native";
import { Provider as PaperProvider ,Appbar, Button, Card, Title, Paragraph} from "react-native-paper";
import store from "./store";
import PostList from "./components/PostList/PostList";

import BottomNavigate from "./components/BottomNavigation/BottomNavigation";
import AppBar from "./components/AppBar/AppBar";

const App = () => {
  const styles = StyleSheet.create({
    container: {
      flex: 1,
    },
  });


  return (
    <View style={styles.container}>
      <Provider store={store}>
        <PaperProvider>
        <Appbar.Header>
        <Appbar.Content title="My App" />
      </Appbar.Header>
      <PostList/>
      <Card>
        <Card.Cover source={{ uri: 'https://picsum.photos/700' }} />
        <Card.Content>
          <Title>Card Title</Title>
          <Paragraph>
            This is a longer card description that wraps to multiple lines.
          </Paragraph>
        </Card.Content>
        <Card.Actions>
          <Button>Cancel</Button>
          <Button>OK</Button>
        </Card.Actions>
      </Card>
        </PaperProvider>
      </Provider>
    </View>
  );
};

export default App;
